import React, { Component } from 'react';
import ProfilePic from 'spotlight.jpg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App-sections">
        <header className="App-text">
          <p>
            Vardhan Dugar
          </p>
        </header>
        <img src={ProfilePic} className="App-image">
        </img>
      </div>
    );
  }
}

export default App;
